import Header from '../pageElements/Header';

export default function Feed() {

  return (
      <div className="container-fluid">
          <div className="row">
              <Header links={true}/>
              <div className="container py-4">
                  <div className="row">
                      <aside className="col-3">
                            categories
                      </aside>
                      <section className="col-7">

                      </section>
                      <aside className="col-2">
                          ad section
                      </aside>
                  </div>
              </div>
          </div>
      </div>
  );
}
